import React from "react";
import "./BrewConnect.css";
import Epicurious from "../../img/products/logos/epicurious.jpg";
import GQ from "../../img/products/logos/gq.png";
import CNN from "../../img/products/logos/CNN-logo.png";
import Forbes from "../../img/products/logos/forbes.png";
import WSJ from "../../img/products/logos/wsj.png";
import Barrons from "../../img/products/logos/barrons.svg";

const BrewConnect = () => {
  return (
    <div className="trade-connect">
      <div className="title">
        Brewfather connects you with coffee you'll love.
      </div>
      <div className="media-logos">
        <img src={Epicurious} alt="Epicurious" />
        <img src="https://www.example.com/path/to/vogue-logo.png" alt="Vogue" />
        <img src="https://www.example.com/path/to/gq-logo.png" alt="GQ" />
        <img
          src="https://www.example.com/path/to/forbes-logo.png"
          alt="Forbes"
        />
        <img src="https://www.example.com/path/to/cnn-logo.png" alt="CNN" />
        <img
          src="https://www.example.com/path/to/barrons-logo.png"
          alt="Barrons"
        />
        <img
          src="https://www.example.com/path/to/wsj-logo.png"
          alt="Wall Street Journal"
        />
      </div>
    </div>
  );
};

export default BrewConnect;
